import React from 'react';
import './App.css';
import Main1 from './Components/main';
import 'bootstrap/dist/css/bootstrap.min.css';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import {useEffect} from 'react'

class App extends React.Component{
  constructor(){
    super()
    this.state={
      value2:'',
      value3:"LTC",
      value4:"BTC",
      value5:'ltc',
      value6:"btc",
      value10:'lite',
      value11:'bit',
      from:'ltc',
      to:'btc',
      show:'none',
      liverate:''
    }
  }

  changevalue = ()=>{
    this.setState({
      value2:'receive',

    })
  }

  reverse1= ()=>{
    this.setState({
      value3:this.state.value4,
      value4:this.state.value3,
      value5:this.state.value6,
      value6:this.state.value5,
      value10:this.state.value11,
      value11:this.state.value10
    })
  }

  changetodoge1 = ()=>{
    this.setState({
      value3:'DOGE',
      value5:'doge',
      value10:'doge',
      from:'doge'
    })
  }


  changetodoge2 = (event2)=>{
    this.setState({
      value4:'DOGE',
      value6:'doge',
      value11:'doge',
      from:'ltc1',
      to:'doge',
    })
    const value100=event2.target.value
    if (value100[0]!='D') {
      this.setState({
        show:'block'
      })
    }
    if (value100[0]=='D') {
      this.setState({
        show:'none'
      })
    }
    if (value100[0]==null) {
      this.setState({
        show:'none'
      })
    }

  }


  changetoltc1 = ()=>{
    this.setState({
      value3:'LTC',
      value5:'ltc',
      value10:'lite',
      from:'ltc1',
      to:'doge'
    })
  }

  changetoltc2 = (event2)=>{
    this.setState({
      value4:'LTC',
      value6:'ltc',
      value11:'lite',
      to:'ltc',
    })

    const value100=event2.target.value
    if (value100[0]!='L' && value100[0]!='M') {
      this.setState({
        show:'block'
      })
    }
    if (value100[0]=='L' || value100[0]=='M' || value100[0]=='l' || value100[0]=='l'  ) {
      this.setState({
        show:'none'
      })
    }
    if (value100[0]==null) {
      this.setState({
        show:'none'
      })
    }

  }

  changetobtc1 = ()=>{
    this.setState({
      value3:'BTC',
      value5:'btc',
      value10:'bit',
      from:'btc',
      to:'ltc'
    })
  }

  changetobtc2 = (event2)=>{
    this.setState({
      value4:'BTC',
      value6:'btc',
      value11:'bit',
      to:'btc'
    })

    const value100=event2.target.value
    if (value100[0]!='3' && value100[0]!='1' && (value100[0]!='b' && value100[1]!='c') ) {
      this.setState({
        show:'block'
